sourcesContent:
 async function getContestData(){
  fetch('https://kontests.net/api/v1/all')
  .then((res) => res.json())
  .then((data) => {
    console.log(data);
    return data;
  })
}

function App() {
  const data = getContestData();
  data.then(dat => console.log(dat));
  return 'hiohdaso';
}

export default App;
